// 	Time Limit Exceeded
func maximalRectangle1(matrix [][]byte) int {
	if len(matrix) == 0 {
		return 0
	}
	rst, w, h := 0, len(matrix[0]), len(matrix)

	var zeroSlice [][]int

	for i := 0; i < w; i++ {
		for j := 0; j < h; j++ {
			if matrix[j][i] == '0' {
				zeroSlice = append(zeroSlice, []int{j, i})
			}
		}
	}

	// x y 左上角坐标，x1 y1 右上角坐标
	validateFunc := func(x, y, x1, y1 int) bool {
		for _, v := range zeroSlice {
			if v[0] >= x && v[0] <= x1 && v[1] >= y && v[1] <= y1 {
				return false
			}
		}
		return true
	}

	for i := 0; i < w; i++ {
		for j := 0; j < h; j++ {
			if matrix[j][i] == '0' {
				continue
			}

			for ii := i; ii < w; ii++ {
				if matrix[j][ii] == '0' {
					break
				}

				for jj := j; jj < h; jj++ {
					if matrix[jj][ii] == '0' || matrix[jj][i] == '0' {
						break
					}

					if !validateFunc(j, i, jj, ii) {
						break
					}

					tmpSize := (ii - i + 1) * (jj - j + 1)
					if tmpSize > rst {
						rst = tmpSize
					}
				}
			}
		}
	}

	return rst
}

func maximalRectangle(matrix [][]byte) int {
	if len(matrix) == 0 {
		return 0
	}

	matrixHigh := make([][]int, len(matrix))
	for i := 0; i < len(matrix); i++ {
		matrixHigh[i] = make([]int, len(matrix[0]))
	}

	for i := 0; i < len(matrix[0]); i++ {
		matrixHigh[0][i] = int(matrix[0][i] - '0')
	}

	for i := 1; i < len(matrix); i++ {
		for j := 0; j < len(matrix[0]); j++ {
			if matrix[i][j] == '0' {
				matrixHigh[i][j] = 0
			} else {
				matrixHigh[i][j] = matrixHigh[i-1][j] + 1
			}
		}
	}

	max := func(a, b int) int {
		if a >= b {
			return a
		}
		return b
	}

	maxArea := 0
	for i := 0; i < len(matrixHigh); i++ {
		for j := 0; j < len(matrixHigh[0]); j++ {
			if matrixHigh[i][j] == 0 {
				continue
			}
			width := 1
			for k := j + 1; k < len(matrixHigh[0]); k++ {
				if matrixHigh[i][k] < matrixHigh[i][j] {
					break
				}
				width++
			}
			for k := j - 1; k >= 0; k-- {
				if matrixHigh[i][k] < matrixHigh[i][j] {
					break
				}
				width++
			}
			maxArea = max(maxArea, matrixHigh[i][j]*width)
		}
	}

	return maxArea
}
